// components/Playlist/Playlist.js

import React from 'react';
import Song from '../Song/Song'; // Import the Song component from its new location
import songsData from '../../data/songs'; // Import songs.json from its new location

const Playlist = () => {
    useEffect(() => {
        console.log(songsData); // Log the imported data to the console
      }, []); // Empty dependency array to run this effect only once when component mounts

      return <div>My Component</div>;
};

export default Playlist;
